type TradeStatus string

const (
	TradeStatusPending   TradeStatus = "pending"
	TradeStatusOffering  TradeStatus = "offering"
	TradeStatusConfirmed TradeStatus = "confirmed"
	TradeStatusCompleted TradeStatus = "completed"
	TradeStatusCancelled TradeStatus = "cancelled"
	TradeStatusExpired   TradeStatus = "expired"
)

// AllValues returns all TradeStatus values.
func (TradeStatus) AllValues() []TradeStatus {
	return []TradeStatus{
		TradeStatusPending,
		TradeStatusOffering,
		TradeStatusConfirmed,
		TradeStatusCompleted,
		TradeStatusCancelled,
		TradeStatusExpired,
	}
}

// MarshalText implements encoding.TextMarshaler.
func (s TradeStatus) MarshalText() ([]byte, error) {
	switch s {
	case TradeStatusPending:
		return []byte(s), nil
	case TradeStatusOffering:
		return []byte(s), nil
	case TradeStatusConfirmed:
		return []byte(s), nil
	case TradeStatusCompleted:
		return []byte(s), nil
	case TradeStatusCancelled:
		return []byte(s), nil
	case TradeStatusExpired:
		return []byte(s), nil
	default:
		return nil, errors.Errorf("invalid value: %q", s)
	}
}

// UnmarshalText implements encoding.TextUnmarshaler.
func (s *TradeStatus) UnmarshalText(data []byte) error {
	switch TradeStatus(data) {
	case TradeStatusPending:
		*s = TradeStatusPending
		return nil
	case TradeStatusOffering:
		*s = TradeStatusOffering
		return nil
	case TradeStatusConfirmed:
		*s = TradeStatusConfirmed
		return nil
	case TradeStatusCompleted:
		*s = TradeStatusCompleted
		return nil
	case TradeStatusCancelled:
		*s = TradeStatusCancelled
		return nil
	case TradeStatusExpired:
		*s = TradeStatusExpired
		return nil
	default:
		return errors.Errorf("invalid value: %q", data)
	}
}
